import React from 'react';
import {Link, NavLink} from 'react-router-dom';

const Error = () => {
    return (
        <>
            <div className="setStyle3">
                <h1> About Page </h1>
                <p> Welcome to my world </p>
            </div>
        </>
    );
}

export default Error;
